"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Inguinal and femoral (groin) hernias (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/inguinal-and-femoral-groin-hernias-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H16277433\">",
"      <span class=\"h1\">",
"       What is a hernia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A hernia is an area in a layer of tissue that is weak or torn. Often when there is a hernia, other tissues that are normally held in by the damaged layer bulge or stick out through the weak or torn spot.",
"     </p>",
"     <p>",
"      Hernias can happen in different parts of the body. When they happen where the thigh and body meet (called the groin), they are called inguinal or femoral hernias. Inguinal hernias are a bit higher on the groin than femoral hernias (",
"      <a class=\"graphic graphic_figure graphicRef64249 \" href=\"mobipreview.htm?41/62/42976\">",
"       figure 1",
"      </a>",
"      ). Both of these types of hernias can form a sac that holds a loop of intestine or a piece of fat pad that normally sits inside the belly. The fat pad is called the omentum. In women, the sac can hold female reproductive organs.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H16277440\">",
"      <span class=\"h1\">",
"       What are the symptoms of a groin hernia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Groin hernias do not always cause symptoms. But when symptoms do occur, they can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        A heavy or tugging feeling in the groin area",
"       </li>",
"       <li>",
"        Dull pain that is worst when straining, lifting, coughing, or otherwise using the muscles near the groin",
"       </li>",
"       <li>",
"        A bulge or lump at the groin",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Hernias can be very painful and even dangerous if the tissue in the hernia becomes trapped and unable to slide back into the belly (",
"      <a class=\"graphic graphic_figure graphicRef76003 \" href=\"mobipreview.htm?23/6/23648\">",
"       figure 2",
"      </a>",
"      ). When this happens, the tissue does not get enough blood, so it can get damaged or die. This is more likely with femoral hernias than with inguinal hernias.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H16277447\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. See a doctor or nurse if you:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Feel or see a bulge in your groin, or",
"       </li>",
"       <li>",
"        Feel a pulling sensation or pain in your groin even if you have no bulge",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      In most cases, doctors can diagnose a hernia just by doing an exam. During the exam, the doctor will ask you to cough while pressing on the bulge. This can be uncomfortable, but it is necessary to find the source of the problem.",
"     </p>",
"     <p>",
"      Most of the time, the contents of the hernia can be &ldquo;reduced,&rdquo; or gently pushed back into the belly. Still, there are times when the hernia gets trapped and can&rsquo;t be pushed back in. If that happens, the tissue that is trapped can get damaged.",
"     </p>",
"     <p>",
"      If you develop pain around the bulge or feel sick, call your doctor or surgeon right away.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H16277454\">",
"      <span class=\"h1\">",
"       How are hernias treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Not all hernias need treatment right away. But many do need to be repaired with surgery. Femoral hernias, in particular, usually need repair. They are more likely than inguinal hernias to cause tissue damage (",
"      <a class=\"graphic graphic_figure graphicRef64249 \" href=\"mobipreview.htm?41/62/42976\">",
"       figure 1",
"      </a>",
"      ). &nbsp;",
"     </p>",
"     <p>",
"      Surgeons can repair groin hernias in 1 of 2 ways. The right surgery for you will depend on the size of your hernia, whether this is the first time it is getting repaired, and what your general health is like. The 2 types of surgery are:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Open surgery",
"        </strong>",
"        &ndash; During an open surgery, the surgeon makes an incision near the hernia. Then he or she gently pushes the bulging tissue back into place. Next, the surgeon sews the weak tissue layer back together, so that nothing can bulge through. In some cases, surgeons will also patch the area with a piece of mesh. The mesh can take some of the strain off the tissue wall. That way the hernia is less likely to happen again.",
"       </li>",
"       <li>",
"        <strong>",
"         Laparoscopic surgery",
"        </strong>",
"        &ndash; During laparoscopic surgery, the surgeon makes a few incisions that are much smaller than those used in open surgery. Then he or she inserts long thin tools into the area near the hernia. One of the tools has a camera (called a &ldquo;laparoscope&rdquo;) on the end, which sends pictures to a TV screen. The surgeon can look at the picture on the screen to guide his or her movements. Then he or she uses the long tools to repair the weak tissue layer either with stitches alone or with mesh.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If your hernia has reduced the blood supply to a loop of intestine, your doctor might need to remove that piece of intestine and sew the 2 ends back together.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H16277521\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?13/53/14162?source=see_link\">",
"       Patient information: Abdominal wall hernias (The Basics)",
"      </a>",
"     </p>",
"    </div>",
