"     3-0.03 mg (28): $76.68",
"    </p>",
"   </div>",
"   <div class=\"block mop drugH1Div\" id=\"F163780\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Before starting therapy, a physical exam with reference to the breasts and pelvis are recommended, including a Papanicolaou smear. Exam may be deferred if appropriate; pregnancy should be ruled out prior to use. Monitor patient closely for loss of vision, sudden onset of proptosis, diplopia, migraine; blood pressure; signs and symptoms of thromboembolic disorders; signs or symptoms of depression; glycemic control in patients with diabetes; lipid profiles in patients being treated for hyperlipidemias; serum potassium in high-risk patients and those on medications with potassium-retaining properties. Adequate diagnostic measures, including endometrial sampling, if indicated, should be performed to rule out malignancy in all cases of undiagnosed abnormal vaginal bleeding.",
"    </p>",
"   </div>",
"   <div class=\"list fbnlist drugH1Div drugBrandNames\" id=\"F855145\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     International Brand Names",
"    </span>",
"    <ul>",
"     <li>",
"      Angeliq (AU, BB, BM, BS, BZ, CL, CO, CR, DO, EC, EE, FR, GB, GT, GY, HK, HN, ID, IE, IL, JM, KP, NI, NL, PA, PR, SR, SV, TH, TT);",
"     </li>",
"     <li>",
"      Jasmine (FR);",
"     </li>",
"     <li>",
"      Jasminelle (FR);",
"     </li>",
"     <li>",
"      Melodia (TH);",
"     </li>",
"     <li>",
"      Yarina (RU);",
"     </li>",
"     <li>",
"      Yasmin (AR, AT, AU, BB, BM, BR, BS, BZ, CH, CL, CN, CO, CR, DE, DK, DO, EC, ES, FI, GB, GT, GY, HK, HN, ID, IE, IL, IN, IT, JM, MX, MY, NI, NL, NO, NZ, PA, PE, PH, PL, PR, PT, PY, SE, SG, SR, SV, TH, TR, TT, TW, UY, VE, ZA);",
"     </li>",
"     <li>",
"      Yasmin IQ (PE);",
"     </li>",
"     <li>",
"      Yasminelle (BE, CH, CZ, DE, EE, NO, PL, PT);",
"     </li>",
"     <li>",
"      Yax Femicare (GT);",
"     </li>",
"     <li>",
"      YAZ (AU, BB, BG, BM, BS, BZ, CR, DO, EC, GT, GY, HK, HN, ID, IL, JM, KP, MY, NI, NL, NZ, PA, PH, PR, SG, SR, SV, TH, TT, TW)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F163771\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Combination oral contraceptives inhibit ovulation via a negative feedback mechanism on the hypothalamus, which alters the normal pattern of gonadotropin secretion of a follicle-stimulating hormone (FSH) and luteinizing hormone by the anterior pituitary. The follicular phase FSH and midcycle surge of gonadotropins are inhibited. In addition, oral contraceptives produce alterations in the genital tract, including changes in the cervical mucus, rendering it unfavorable for sperm penetration even if ovulation occurs. Changes in the endometrium may also occur, producing an unfavorable environment for nidation. Oral contraceptive drugs may alter the tubal transport of the ova through the fallopian tubes. Progestational agents may also alter sperm fertility. Drospirenone is a spironolactone analogue with antimineralocorticoid and antiandrogenic activity.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F163786\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: Drospirenone: ~4 L/kg; Ethinyl estradiol: ~4-5 L/kg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: Drospirenone: Serum proteins (excluding sex hormone-binding globulin and corticosteroid-binding globulin): ~97%; Ethinyl estradiol: ~98% to serum albumin",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Drospirenone: To inactive metabolites, minor metabolism hepatically via CYP3A4; Ethinyl estradiol: Hepatic via CYP3A4; forms metabolites; undergoes first-pass metabolism and enterohepatic circulation",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Bioavailability: Drospirenone: ~76%; Ethinyl estradiol: ~40%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: Terminal: Drospirenone: ~30 hours; Ethinyl estradiol: ~24 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak: 1-3 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Drospirenone, ethinyl estradiol: Urine and feces",
"    </p>",
"   </div>",
"  </div>",
