var title_f41_62_42989="Corrected intrinsic PEEP";
var content_f41_62_42989=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F79638&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F79638&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Spuriously elevated intrinsic PEEP",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 326px; height: 280px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Individual values of intrinsic PEEP (auto-PEEP) measured on esophageal tracings (PEEPi dyn) compared with values obtained after subtracting for the rise in gastric pressure resulting from expiratory muscle activity (PEEPi corrected). The difference shown represents the contribution of expiratory muscle activity to the measured auto-PEEP. The corrected auto-PEEPi would be that component of auto-PEEP expected to be responsive to the application of PEEP. Thus, the presence of expiratory muscle activity can lead to the erroneous impression of a higher level of auto-PEEP and to the application of PEEP in an amount which might result in worsened dynamic pulmonary hyperinflation.",
"    <div class=\"footnotes\">",
"     PEEP: positive end-expiratory pressure.",
"    </div>",
"    <div class=\"reference\">",
"     Redrawn from Lessard MR, Lofaso F, Brochard L. Am J Respir Crit Care Med 1995; 151:562.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
